create table proxy_list
(
    id              serial      not null
        constraint proxy_list_pk
            primary key,
    ip              varchar(20) not null,
    port            integer     not null,
    anonymity_level smallint    not null,
    uptime          numeric(5, 2),
    response        integer,
    isp             varchar,
    organization    varchar,
    country         varchar(50),
    region          varchar(50),
    city            varchar(50),
    latitude        numeric(9, 6),
    longitude       numeric(9, 6),
    site_scraped    varchar(50),
    date_scraped    timestamp,
    protocol        varchar(20)
);

comment on column proxy_list.response is 'in milliseconds';

alter table proxy_list
    owner to postgres;

create unique index proxy_list_id_uindex
    on proxy_list (id);

create unique index proxy_list_ip_uindex
    on proxy_list (ip);

